import React from 'react'
import { Company } from './Entitis.type';
import { useState, useEffect, useCallback } from 'react';

type Props = {
  token: string
};
const HomeAdmin = (props: Props) => {

  const [company, setCompany] = useState<Array<Company>>([]);
  console.log(props.token);
  useEffect(() => {
    fetch('http://localhost:8080/admin/company/all', {
      method: 'GET',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).then((res) => res.json()).then((data) => {
      setCompany(data)
      console.log(data); // log response data to console
    }).catch((error) => console.log(error));
  }, []); // add empty array to run useEffect only once on component mount

  return (
    <div className='coupon'>
      {

        company.map((companys) => {
          return (
            <>
              <tr key={companys.id}></tr><br />
              <td>{companys.name}</td><br />
              <td>{companys.email}</td><br />
              <td>{companys.coupons.map((coupons) => {
                return (
                  <>
                     <td>{coupons.category}</td><br />
                     <td>{coupons.price}</td><br />
                    </>
                )
              })}</td><br />
              <td> { }</td><br />
              <td>{ }</td><br />
            </>
          )
        })}
    </div>

  )
}

export default HomeAdmin;
